import React from 'react';
import './App.css';
import Story from './components/Story';

function App() {
  const fetchStories = async () => {
    const list = await fetch("https://sv-reqres.now.sh/api/listings");
    const stories = await list.json();
    return stories.data;
  }

  let stories = fetchStories();

  return (
    <div className="wrapper">
      stories.map( stories => (
        <Story title={stories.title} story={stories.description} url={stories.weburl}/>
      ))
    </div>
  );
}

export default App;
